import React from 'react'

function App() {
  const counter: number = 1
  const sayHello = () => {
    console.log("Hello World")
  }
  return (
    <div>
      <h1> Hello world </h1>
      <button onClick={sayHello}> {counter} </button>
    </div>
  )
}

export default  App
